import "antd/dist/antd.css";

import React, { Component } from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";
const App = () => {
  return <Component />;
};

App.prototype = {
  Component: PropTypes.element.isRequired,
};

export default App;
